#include <includes.hpp>

char* cw::DecryptString(char* str) {
	if ((*str & 0xC0) == 0x80) {
		// encrypted
		str[0] = 0;
		str[1] = 0;
	}
	return str; // decrypt::DecryptString(str);
}

